class RegApprovalComponent {
    constructor(accountService, router, toastr, fb, regApprovalService, modalService) {
        this.accountService = accountService;
        this.router = router;
        this.toastr = toastr;
        this.fb = fb;
        this.regApprovalService = regApprovalService;
        this.modalService = modalService;
        this.roleList = [];
        this.totalCount = 0;
        this.bsValue = new Date();
        this.config = {
            keyboard: false,
            class: 'modal-lg',
            ignoreBackdropClick: true
        };
    }
    ngOnInit() {
        this.getRoles();
        this.bsConfig = Object.assign({}, { containerClass: 'theme-green' }, { dateInputFormat: 'DD/MM/YYYY' });
        this.bsValue = new Date();
    }
    openRegApprovalSearchModal(template) {
        this.RegApprovalSearchModalRef = this.modalService.show(template, this.config);
    }
    getEmployeeFormApproval() {
        this.regApprovalService.getEmployeeFormApproval().subscribe(response => {
            debugger;
            this.regApprovals = response;
            this.openRegApprovalSearchModal(this.regApprovalSearchModal);
            //this.totalCount = response.count;
        }, error => {
            console.log(error);
        });
    }
    getRegApproved() {
        this.regApprovalService.getRegApproved().subscribe(response => {
            debugger;
            this.regApprovals = response;
            this.openRegApprovalSearchModal(this.regApprovalSearchModal);
            //this.totalCount = response.count;
        }, error => {
            console.log(error);
        });
    }
    selectRegApproval(selectedRecord) {
        this.regApprovalService.regApprovalFormData = Object.assign({}, selectedRecord);
        this.getUserById();
        this.RegApprovalSearchModalRef.hide();
    }
    onSubmit(form) {
        this.updateRegApproval(form);
    }
    updateRegApproval(form) {
        this.regApprovalService.updateRegApproval().subscribe(res => {
            debugger;
            this.resetForm(form);
            this.toastr.info('Updated successfully', 'User registration Approval');
        }, err => { console.log(err); });
    }
    populateForm() {
        //this.regApprovalService.campaignFormData = Object.assign({}, selectedRecord);
    }
    resetForm(form) {
        form.form.reset();
        //this.regApprovalService.campaignFormData = new Campaign();
    }
    getRoles() {
        this.roleList = [];
        this.accountService.getRoles().subscribe((response) => {
            if (response) {
                this.roleList = response;
            }
        }, (error) => {
            this.errors = error.errors;
        });
    }
    getUserById() {
        this.accountService.getUserById(this.regApprovalService.regApprovalFormData.userId).subscribe((response) => {
            if (response) {
                response.roles.forEach(element => {
                    this.regApprovalService.regApprovalFormData.role = element;
                });
            }
        }, (error) => {
            this.errors = error.errors;
        });
    }
}
